import axios from "axios";
const headers = {
  "Content-Type": "application/json"
};
const burl = "http://localhost:8800";

export default {
  createEcurie: function(send) {
    return axios.post(`${burl}/ecurie/create-ecurie`, send, {
      headers: headers
    });
  },
  getEcuries: function(send) {
    return axios.post(`${burl}/ecurie/get-ecuries`, send, {
      headers: headers
    });
  },
  deleteEcurie: function(send) {
    return axios.post(`${burl}/ecurie/delete-ecurie`, send, {
      headers: headers
    });
  }
};
